  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Nowtina
  NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, fire management, water rights, and wilderness
  areas. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, and fisheries resources. The public uses of the Refuge described in
  this report include hunting, trapping, and law enforcement. The equipment and facilities
  section of the report provides information about rehabilitation and communication
  systems. Items of interest are provided at the end.\",\n\t\"license_title\": \"License
